import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

// Global error handler to suppress WalletConnect session topic errors
const originalError = window.onerror;
window.onerror = (message, source, lineno, colno, error) => {
  if (error && error.message && error.message.includes('No matching key. session topic doesn\'t exist')) {
    console.log('Suppressing WalletConnect session topic error:', error.message);
    return true; // Prevent default error handling
  }
  if (originalError) {
    return originalError(message, source, lineno, colno, error);
  }
  return false;
};

// Global unhandled promise rejection handler
const originalUnhandledRejection = window.onunhandledrejection;
window.onunhandledrejection = function(event: PromiseRejectionEvent) {
  if (event.reason && event.reason.message && event.reason.message.includes('No matching key. session topic doesn\'t exist')) {
    console.log('Suppressing WalletConnect session topic promise rejection:', event.reason.message);
    event.preventDefault();
    return;
  }
  if (originalUnhandledRejection) {
    return originalUnhandledRejection.call(window, event);
  }
};

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
